       I cleaned the ME Region, used another bios that works, replace oxidized components c3150, c3140, c2940, R0920,1984 Q4262 , Replaces U5511, Q5520,Q5050,Q5510,Q5515 sensors, because the mac does not speed up the cooler when it disconnects flex like trackpad, cam and wifi, reball in SMC but without success.

